// const logo = require("./public/images/isitcom.png");
function Header() {
  const auth = useSelector(state => state.auth)
  return (
    <header>
      <div className="Isitcom__Pfe_library_ box">
        <img src="/images/isitcom.png" alt="Isitcom" className="Groupe_4" />

        <h1>
          <Link to="/">
            <span>Isitcom Pfe library</span>
          </Link>
        </h1>
      </div>
      <ul>

        <li>
          <Link to="/login">
            <i className="fas fa-user"></i>Login
          </Link>
        </li>
      </ul>
    </header>
  );
}

export default Header;
